css:
.tool-panel {
  color: #57ff57;
}
.tool-panel.panel-bottom {
  border-top: 1px solid #57ff57;
}
.tool-panel.panel-left {
  border-right: 1px solid #57ff57;
}
.tool-panel.panel-right {
  border-left: 1px solid #57ff57;
}
.inset-panel {
  position: relative;
  background-color: #57ff57;
}
.scrollbars-visible-always ::-webkit-scrollbar {
  width: 7px;
  height: 7px;
}
.scrollbars-visible-always ::-webkit-scrollbar-thumb {
  background: #57ff57;
}
.tab-bar {
  background-color: #000000;
  border-bottom: 1px solid #57ff57;
}
.tab-bar .tab {
  max-width: 170px;
  line-height: 32px;
  color: #57ff57;
}
.tab-bar .tab .title {
  padding-left: 10px;
}
.tab-bar .tab .close-icon {
  line-height: 31px;
}
.tab-bar .tab.active {
  background-color: #57ff57;
  color: #000000;
}
.tab-bar .tab + .tab {
  border-right: 1px solid #57ff57;
  border-left: 1px solid #57ff57;
}
.tree-view .entry.directory > .header {
  font-weight: bold;
  text-decoration: underline;
}
.tree-view .entry.directory.selected > .header {
  color: #000000;
}
.tree-view .entry.file.selected > .name {
  color: #000000;
}
.overlay {
  color: #000000;
  background-color: #57ff57;
  padding: 2px;
  padding-right: 0px;
  border: 1px solid #57ff57;
  box-shadow: 0 0 5px #57ff57;
}
.overlay .editor.mini {
  padding: 5px;
  margin-bottom: 0px;
  border: 1px solid #57ff57;
}
.overlay .select-list ol.list-group,
.overlay.select-list ol.list-group {
  background-color: #000000;
  color: #57ff57;
}
.overlay .select-list ol.list-group li,
.overlay.select-list ol.list-group li {
  padding: 10px;
  border-right: 1px solid #57ff57;
}
.overlay .select-list ol.list-group li.selected,
.overlay.select-list ol.list-group li.selected {
  font-weight: bold;
  color: #000000;
  background-color: #57ff57;
}
.select-list.popover-list {
  background-color: #000000;
  box-shadow: 0 0 5px #57ff57;
  padding: 5px;
  border: 1px solid #57ff57;
}
.select-list.popover-list .editor {
  margin-bottom: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
